/* eslint-disable no-unused-vars */
import getCookie from "@/plugins/cookie";
("@/plugins/cookie");

export default async function ({ next, to }) {
  if (getCookie("userToken")) {
    next({ name: "Login" });
    return false;
  }
  return true;
}
